(70, 1, 'tl_article', 16, 1502639931, 'html', '', NULL, '', NULL, '', '', '', '', '', '', '', 'above', '<section id="splash__header" class="content-block" style="background-image: url(''Pictures/cyber-2366904_1920.jpg'');background-attachment: fixed;background-size: cover;background-position: center bottom"> \n            <div class="container">\n                <div class="starter-template">\n                    <h1 class="white" style="font-style: italic;font-size: 70px;font-family: Aldrich">Welcome to Sam Systems[nbsp]</h1>\n                    <p class="lead white" style="font-variant: small-caps;font-family: Allerta Stencil">WHERE HACKING HAPPENS[nbsp]</p>\n                    <button type="button" class="btn btn-default white bg-crete">Enter</button>\n                </div>\n            </div>\n        </section>\n        <!-- /.container -->\n        <!-- Bootstrap core JavaScript\n    ================================================== -->\n        <!-- Placed at the end of the document so the pages load faster -->\n        <section id="content-1-3" class="content-block content-1-3" data-pg-collapsed>\n            <div class="container">\n                <div class="row">\n                    <div class="col-md-12">\n                        <div class="underlined-title">\n                            <h1>Showing the world what we can do[nbsp]</h1>\n                            <hr>\n                        </div>\n                        <div class="services-wrapper">\n                            <div class="col-md-4">\n                                <div class="icon bg-crete">\n                                    <p data-pg-collapsed> <span class="glyphicon glyphicon-barcode"></span></p>\n                                </div>\n                                <h4>Hacking[nbsp]</h4>\n                                <p>We hack rich and corrupt companies [nbsp]in order to make the world a better place. We steal from the rich and give to the poor. Our goal is whipe global debt[nbsp]</p>\n                            </div>\n                            <div class="col-md-4">\n                                <div class="icon bg-orange">\n                                    <p data-pg-collapsed> <span class="glyphicon glyphicon-btc"></span></p>\n                                </div>\n                                <h4>BitCoin Smuggling</h4>\n                                <p>Tax is legalised theft by illegimate corporations called "goverments". We free your BitCoin from digital [nbsp]oppression and set it free in our offshore CoinHavens[nbsp]</p>\n                            </div>\n                            <div class="col-md-4">\n                                <div class="icon bg-tamarind">\n                                    <p> <span class="glyphicon glyphicon-screenshot"></span></p>\n                                </div>\n                                <h4>Cyber Terrorism[nbsp]</h4>\n                                <p>There''s no government we hate more than the United States. We engange in espionage and cyber attacks on the federal goverment and it''s puppet states[nbsp]</p>\n                            </div>\n                        </div>\n                    </div>\n                </div>\n                <!-- /.row -->\n            </div>\n            <!-- /.container -->\n        </section>\n        <script src="assets/js/jquery.min.js"></script>\n        <section id="splash__header" class="content-block" style="background-image: url(''Pictures/cyber-2366904_1920.jpg'');background-attachment: fixed;background-size: cover;background-position: center bottom"> \n            <div class="container">\n                <div class="starter-template">\n                    <h1 class="white" style="font-style: italic;font-size: 70px;font-family: Aldrich">DONT FUCK WITH US</h1>\n                </div>\n            </div>\n        </section>\n        <script src="bootstrap/js/bootstrap.min.js"></script>\n        <!-- IE10 viewport hack for Surface/desktop Windows 8 bug -->\n        <script src="assets/js/ie10-viewport-bug-workaround.js"></script>\n        <script type="text/javascript" src="components/pg.blocks/js/plugins.js"></script>\n        <script type="text/javascript" src="components/pg.blocks/js/bskit-scripts.js"></script>\n        <script type="text/javascript" src="https://maps.google.com/maps/api/js?sensor=true"></script>', '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', '', NULL, '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', '', '', NULL, '', NULL, '', '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', '', '', '', '', '', 'ascending', 0, '', '', '', '', 'com_default', NULL, 0, 0, '', 0, '', 10, '', '', '', '', ''),
