(147, 3, 'tl_news', 8, 1505126456, 'text', 'a:2:{s:4:"unit";s:2:"h1";s:5:"value";s:0:"";}', '<p>Alicante is always worth a visit and not to be explored in only a couple of days. To really get a feeling for this city you have to stay longer - this one will be about three weeks. But how do you explore a city best - by sleeping under the stars on a mountain, renting a youth hostel or Airbnb, or even checking into a hotel? This time, we opted for a very reasonably priced Airbnb. Our host who shares her apartment with us is an artist and the whole apartment is furnished with beautiful portrait paintings. Staying in an Airbnb isn''t only a fantastic opportunity for getting to know such interesting people, but also improve your Spanish language skills, because Airbnb''s are often rented by them.</p>', '', NULL, '', '', '', '', '', '', '', 'above', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', '', NULL, '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', '', '', NULL, '', NULL, '', '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', '', '', '', 'ascending', 0, '', '', '', '', 'com_default', NULL, 0, 0, '0', 0, '', 10, '', '', '', '', ''),
