(107, 48, 'tl_article', 1280, 1505327215, 'text', 'a:2:{s:4:"unit";s:2:"h1";s:5:"value";s:11:"Who we are?";}', '<p class="p1">Hi, I''m Sam, the creator of SamLernen. Here I offer everyone an exciting new way of learning English online, for work, for school or for your own personal development. I am a TEFL certified digital nomad who travels Europe and teaches online. I created SamLernen to provide our own exciting platform to teach and organise our courses and communication with our language learners. We believe that the best way to teach English is to offer interesting and exiting content where we learn English through discussion and analysis of world events, philosophy, history. We also work on creative web projects together, using internet technologies to make it even more interactive. The future of learning is here.[nbsp]</p>', '', NULL, '', '', '', '', '', '', '', 'above', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', '', NULL, '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', '', '', NULL, '', NULL, '', '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:"";i:1;s:38:"col-md-4 col-md-offset-1 text-centered";}', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', '1', '', '', 'ascending', 0, '', '', '', '', 'com_default', NULL, 0, 0, '', 0, '', 10, '', '', '', '', ''),
