(119, 52, 'tl_article', 240, 1505325704, 'text', 'a:2:{s:4:"unit";s:2:"h1";s:5:"value";s:14:"Learning Style";}', '<p>I think differently and I am definitely not[nbsp]not politically correct. I say what I want and you should too! Our lessons are a place for free discussion and debate. We like to teach English by discovering what the language really has to offer us. We learn by taking a closer look at world events, music, crime, drugs, history, new technologies and travel.[nbsp]We encourage co-operation and the involvement of friends. Anything that makes learning more fun, makes it easier. You can do a course online with your friends/colleagues in the same room or using different computers. The more people, the more fun.[nbsp]</p>', '', NULL, '', '', '', '', '', '', '', 'above', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', '', NULL, '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', '', '', NULL, '', NULL, '', '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:"";i:1;s:24:"col-md-4 col-md-offset-1";}', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', '', '', '', 'ascending', 0, '', '', '', '', 'com_default', NULL, 0, 0, '', 0, '', 10, '', '', '', '', ''),
(120, 52, 'tl_article', 256, 1505325704, 'text', 'a:2:{s:4:"unit";s:2:"h1";s:5:"value";s:18:"Login in and Learn";}', '<div class="ce_text first block">\n<p>With SamLernen, you have the option to make an account and login. I only activate sign-up requests from clients. When you are signed up, you can organise all of your course work and your lesson times. This is very helpful, as it makes it more easier to access your course information when you are using a work computer or a mobile.When you are logged in, you also have other options like managing your payments, tracking your progress and accessing premium content</p>\n<p>[nbsp]</p>\n</div>\n<div class="ce_text block">[nbsp]</div>', '', NULL, '', '', '', '', '', '', '', 'above', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', '', NULL, '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', '', '', NULL, '', NULL, '', '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:"";i:1;s:24:"col-md-4 col-md-offset-1";}', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', '', '', '', 'ascending', 0, '', '', '', '', 'com_default', NULL, 0, 0, '', 0, '', 10, '', '', '', '', ''),
