(175, 4, 'tl_news', 128, 1505153419, 'text', 'a:2:{s:4:"unit";s:2:"h1";s:5:"value";s:0:"";}', '<p>Sixteen years ago on this day, the 11th September, an airplane crashed into the famous Twin Towers in New York.</p>\n<p>3000 people died, and the world was left with a shock that for many resulted in a trauma. Even if you haven''t been directly and personally affected, may it be possible that behind this date, there is a story bigger than its already devastating effects on its own? Could it be that there are actual psychological effects on not only a small number of naturally traumatized relatives and friends, but also on a whole continent - or the world which has watched the news?</p>\n<p>In a soon upcoming article, we will address this question and take the facts into further inquiry.</p>', '', NULL, '', '', '', '', '', '', '', 'above', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', '', NULL, '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', '', '', NULL, '', NULL, '', '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', '', '', '', 'ascending', 0, '', '', '', '', 'com_default', NULL, 0, 0, '0', 0, '', 10, '', '', '', '', ''),
