(179, 61, 'tl_article', 384, 1505155660, 'text', 'a:2:{s:4:"unit";s:2:"h3";s:5:"value";s:24:"The problems with Macron";}', '<p>Macron has been elected the new president of France.[nbsp]</p>\n<p>Emmanuel Macron[nbsp]won the 2017 French elections against Marine Le Pen with 73% of the votes. Marine Le Pen was seen as a more radical, right-wing politician who wanted France to leave the European Union.[nbsp]</p>\n<p>But who is this man and is he similar to Donald Trump?[nbsp]</p>\n<p>He is similar to president Trump in many ways. Both men have a background in business and finance, both presented themselves as "political outsiders" and both were unique candidates in their own way. Le Pen would be the first female president of France and Macron, with a background in investment banking and politics, created his own political party called[nbsp]<em>En Marche</em>[nbsp]and will be the youngest French head of state since Napoleon.[nbsp]</p>\n<p>[nbsp]</p>', '', 0x24e1e54c7d9311e7b1baec9b4278947f, '', '', 'a:3:{i:0;s:3:"100";i:1;s:3:"100";i:2;s:3:"box";}', 'a:5:{s:6:"bottom";s:0:"";s:4:"left";s:0:"";s:5:"right";s:0:"";s:3:"top";s:0:"";s:4:"unit";s:0:"";}', '', '', '', 'right', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', '', NULL, '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', '', '', NULL, '', NULL, '', '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', '', '', '', 'ascending', 0, '', '', '', '', 'com_default', NULL, 0, 0, '', 0, '', 10, '', '', '', '', ''),
