(180, 61, 'tl_article', 512, 1505155686, 'text', 'a:2:{s:4:"unit";s:2:"h1";s:5:"value";s:29:"Does Macron think like Trump?";}', '<p>Macron is a very rich man who made a lot of money with investment banking at Rotschild [&] Cie Banque. The Rotschild family and its companies are infamous for it''s enormous wealth and global political power. Many claim they form the "Hidden Hand", an elite group of extremely wealthy people, families and companies who[nbsp]<em>really</em>[nbsp]rule the world.[nbsp]</p>\n<p>[nbsp]</p>\n<p>Being a successful businessman like Macron or Trump means they must think and act according to simple rules</p>\n<p>[nbsp]</p>\n<p>1) Be open for negotiation, keep in mind needs of all participants</p>\n<p>2) Try to turn enemies into friends, war is too expensive</p>\n<p>3) Never dwell on[nbsp]your mistakes, business first.</p>\n<p>[nbsp]</p>', '', NULL, '', '', '', '', '', '', '', 'above', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', '', NULL, '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', '', '', NULL, 'bwa-GtWp4h4', NULL, 'a:2:{i:0;s:0:"";i:1;s:0:"";}', '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', '', '', '', 'ascending', 0, '', '', '', '', 'com_default', NULL, 0, 0, '', 0, '', 10, '', '', '', '', ''),
