(183, 61, 'tl_article', 640, 1505155743, 'text', 'a:2:{s:4:"unit";s:2:"h3";s:5:"value";s:40:"Macron''s wife is 24 years older than him";}', '<p>Many find it strange how Macron is married toBriget Trogneux, who is 24 years older than him. Their love began when Macron was a 16 year old schoolboy and Bridget was his drama teacher at the school. His parents made him change schools as they were worried about this strange love affair, it didn''t work and they married in 2007. This strange love affair contributed again to Macron''s outsider image, others claim it is a[nbsp]<strong>sham marriage[nbsp]</strong>or that Macron is actually gay.[nbsp]In a way, this strange love affair a little similar to Melania Trump. For one, they both have big[nbsp]<strong>age differences</strong>[nbsp]to their husbands who are both the youngest and oldest ever presidents of their countries[nbsp]<strong>respectively</strong>.[nbsp]</p>', '', NULL, '', '', '', '', '', '', '', 'above', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', '', NULL, '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', '', '', NULL, 'bwa-GtWp4h4', NULL, 'a:2:{i:0;s:0:"";i:1;s:0:"";}', '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', '', '', '', 'ascending', 0, '', '', '', '', 'com_default', NULL, 0, 0, '', 0, '', 10, '', '', '', '', ''),
(184, 61, 'tl_article', 768, 1505155737, 'text', 'a:2:{s:4:"unit";s:2:"h3";s:5:"value";s:30:"The media wanted Macron to win";}', '<p>Unlike Trump in Ameria however, Macron was the media favourite. Macron is pro business and the media is big business. It is a business with enormous social power and in this case, it managed to contribute to the new president''s victory. The media can influence any election by[nbsp]<strong>p</strong><strong>ainting their favourite candidate in a good light[nbsp]</strong>and making others look worse. In the example below, we can clearly see Le Pen being compared with Donald Trump.[nbsp]The media has[nbsp]<strong>done nothing but</strong>[nbsp]make Trump look bad all accross the world. People generally have negative feelings towards Trump. Despite Macron being more similar to trump in less obvious ways, the media used Le Pen''s more radical opinions and even her hair to compare her to Trump.[nbsp]</p>\n<p>[nbsp]</p>', '', NULL, '', '', '', '', '', '', '', 'above', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', '', NULL, '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', '', '', NULL, 'bwa-GtWp4h4', NULL, 'a:2:{i:0;s:0:"";i:1;s:0:"";}', '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', '', '', '', 'ascending', 0, '', '', '', '', 'com_default', NULL, 0, 0, '', 0, '', 10, '', '', '', '', ''),
