(229, 67, 'tl_article', 384, 1505236070, 'text', 'a:2:{s:4:"unit";s:2:"h3";s:5:"value";s:20:"A worldwide overview";}', '<p>Tourism has become a very big industry for many countries such as Spain, Thailand and Egypt to name a few. Many countries who decide to welcome tourists, have beautiful landscapes and beaches but few natural resources. For years, Spain has been one of the top tourist destinations in Europe and it has fully[nbsp]<span style="text-decoration: underline;">embraced</span>[nbsp]this new source of income. After the 2008 financial crisis, countries like Greece, Portugal and Spain were some of the[nbsp]<span style="text-decoration: underline;">hardest hit[nbsp]</span>countries[nbsp]<span style="text-decoration: underline;">due to[nbsp]</span>their enormous debt which they could not repay. Spain still heavily relies on it''s tourist industry to survive. It''s other industries such as agriculture and manufacturing do not bring in the same type of money as tourism. [nbsp]</p>\n<p>Tourism has been good and bad for Spain. The main benefits are financial. It has brought money and many jobs to a country suffering from[nbsp]<span style="text-decoration: underline;">high unemployment</span>. On the other hand, many complain of the destruction of natural beauty and of the Spanish culture. There are now hundreds of ugly tourist resorts all over Spain, many comprise almost entirely of English, German and Dutch tourists. Locals complain that their old towns have been transformed into modern money machines and that the huge tourist population causes[nbsp]<span style="text-decoration: underline;">traffic jams</span>[nbsp]and overcrowding.</p>', '', 0x5d969a9e97db11e7868e0cc47adc87ce, '', '', 'a:3:{i:0;s:3:"100";i:1;s:3:"100";i:2;s:3:"box";}', 'a:5:{s:6:"bottom";s:0:"";s:4:"left";s:0:"";s:5:"right";s:0:"";s:3:"top";s:0:"";s:4:"unit";s:0:"";}', '', '', '', 'right', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', '', NULL, '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', '', '', NULL, '', NULL, '', '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', '', '', '', 'ascending', 0, '', '', '', '', 'com_default', NULL, 0, 0, '', 0, '', 10, '', '', '', '', ''),
