(231, 67, 'tl_article', 640, 1505236106, 'text', 'a:2:{s:4:"unit";s:2:"h3";s:5:"value";s:33:"The booming construction industry";}', '<p>One big effect of the Spansh tourist industry has been the boom in construction. Second homes, hotels, roads, holiday resorts, theme parks and airports to[nbsp]<strong>shuttle in</strong>[nbsp]the tourists like farm animals. Many people have objected to the huge structures created and the destruction of nature which has followed. In the following example we see a picture of a the illegal Algarobbico Hotel near Almeria in Andalucia, Spain. The hotel was built in a protected natural park and was[nbsp]<strong>deemed</strong>[nbsp]illegal by the authorities. Many protested and construction stopped. The problem was that the permission to build was[nbsp]<strong>granted</strong>[nbsp]in the 1980''s, but construction began in 2003, long after the area had become a natural park. There are hundreds of similar cases of illegal construction and horribly complicated beaurocracy.</p>', '', NULL, '', '', '', '', '', '', '', 'above', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', '', NULL, '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', '', '', NULL, 'bwa-GtWp4h4', NULL, 'a:2:{i:0;s:0:"";i:1;s:0:"";}', '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', '', '', '', 'ascending', 0, '', '', '', '', 'com_default', NULL, 0, 0, '', 0, '', 10, '', '', '', '', ''),
