(233, 67, 'tl_article', 768, 1505236140, 'text', 'a:2:{s:4:"unit";s:2:"h3";s:5:"value";s:16:"Cheap air travel";}', '<p>One thing which has enabled tourists to come to a country in[nbsp]<span style="text-decoration: underline;">unprecedented numbers</span>[nbsp]is the rise of cheap flying. Companies such as Ryanair and EasyJet are competing to be the biggest[nbsp]<span style="text-decoration: underline;">Budget Airline Comany</span>[nbsp]. It''s possible to get a flight from London to Barcelona for just 20 Euros! Many years ago flying was seen as a luxury. Something which only the very rich could afford. Airports were much smaller, more relaxed and usually more comfortable. Many people called this the Golden Age of air travel. Now it is[nbsp]<span style="text-decoration: underline;">affordable</span>[nbsp]by almost anybody and it is constantly getting cheaper and cheaper and this means that more and more people will be coming on holiday every year.[nbsp]</p>\n<p>[nbsp]</p>', '', NULL, '', '', '', '', '', '', '', 'above', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', '', NULL, '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', '', '', NULL, 'bwa-GtWp4h4', NULL, 'a:2:{i:0;s:0:"";i:1;s:0:"";}', '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', '', '', '', 'ascending', 0, '', '', '', '', 'com_default', NULL, 0, 0, '', 0, '', 10, '', '', '', '', ''),
