(235, 67, 'tl_article', 1024, 1505236245, 'text', 'a:2:{s:4:"unit";s:2:"h3";s:5:"value";s:10:"Case study";}', '<p>Image you are working for the government of Spain at the Ministry of Tourism. You live in Valencia, this summer the city is expected to see double as many tourists as last year. People are coming from all over the world to see the Science Exhibition. You know that next year the numer of arrivals will double in the region of Valencia. You have 200 million Euros[nbsp]of[nbsp]<span style="text-decoration: underline;">borrowed</span>[nbsp]money to invest, this means that your bosses need to see a[nbsp]<span style="text-decoration: underline;">return on the investment</span>, otherwise you will lose your job.[nbsp]</p>\n<p>[nbsp]</p>\n<p><span style="text-decoration: underline;">Option #1</span>[nbsp]: Invest the money in building new roads and train lines.[nbsp]</p>\n<p><span style="text-decoration: underline;">Option #2</span>[nbsp]: Invest the money in creating new hotels and beach resorts[nbsp]</p>\n<p><span style="text-decoration: underline;">Option #3</span>[nbsp]: Invest the money in expanding or rebuilding the current airport[nbsp]</p>\n<p><span style="text-decoration: underline;">Option #4</span>[nbsp]: Give the money to local people to help improve their businesses</p>\n<p><span style="text-decoration: underline;">Option #5</span>[nbsp]: Build a massive hotel complex on the outisde of town[nbsp]</p>\n<p>Now present your idea at a committee meeting and explain it''s benefits over the other options.</p>\n<p>[nbsp]</p>', '', NULL, '', '', '', '', '', '', '', 'above', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', '', NULL, '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', '', '', NULL, 'bwa-GtWp4h4', NULL, 'a:2:{i:0;s:0:"";i:1;s:0:"";}', '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', '', '', '', 'ascending', 0, '', '', '', '', 'com_default', NULL, 0, 0, '', 0, '', 10, '', '', '', '', ''),
(236, 68, 'tl_article', 128, 1505236997, 'text', 'a:2:{s:4:"unit";s:2:"h1";s:5:"value";s:23:"The expansion of Amazon";}', '<p>Amazon, a word which once made people think of the rain forest in Brazil is now a household name and it is growing. Amazon started as a simple book[nbsp]<span style="text-decoration: underline;">retailer,</span>[nbsp]which then branched out into selling other items, soon it had become a huge[nbsp]<span style="text-decoration: underline;">competitor</span>[nbsp]to Ebay and now usually outsells them. Amazon has launched itself in 16 countries worldwide and sells more and more every year. How is it so successful? Many describe the business model of Amazon as one which "is designed to strangle and kill off local business", they do this by offering lower prices and fairly low delivery times. How do they do this?[nbsp]<span style="text-decoration: underline;">Offshore tax evasion</span>[nbsp]and highly organised mass production style distribution centres. Workers in these centers often complain of low[nbsp]<span style="text-decoration: underline;">wages,</span>[nbsp]limited toilet breaks and harsh working conditions. Amazon has recently began to expand its[nbsp]<span style="text-decoration: underline;">presence</span>[nbsp]and many post offices and university campuses now have Amazon delivery stations</p>', '', NULL, '', '', '', '', '', '', '', 'above', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', '', NULL, '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', '', '', NULL, '', NULL, '', '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', '', '', '', 'ascending', 0, '', '', '', '', 'com_default', NULL, 0, 0, '0', 0, '', 10, '', '', '', '', ''),
