(238, 68, 'tl_article', 384, 1505237040, 'text', 'a:2:{s:4:"unit";s:2:"h1";s:5:"value";s:24:"Expanding into our lives";}', '<p>Where can we now see Amazon? How about in your own home! Yes Amazon has recently launched its Amazon Echo. A device which sits somewhere in your home, perhaps your kitchen and living room. It listens to all conversation and its AI is activated when you talk to it by name, Alexa.</p>\n<p>It can be used for many things such as saving and reading shopping lists, reading audiobooks, playing music, asking general questions to Google and primarily, for shopping.</p>\n<p>Watch the Youtube video, a UK[nbsp]<span style="text-decoration: underline;">commercial</span>[nbsp]for the Amazon Echo. A common remark is that the man has replaced his wife with the Amazon Alexa.</p>', '', NULL, '', '', '', '', '', '', '', 'above', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', '', NULL, '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', '', '', NULL, '', NULL, '', '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', '', '', '', 'ascending', 0, '', '', '', '', 'com_default', NULL, 0, 0, '0', 0, '', 10, '', '', '', '', ''),
