(277, 48, 'tl_article', 1008, 1505327209, 'text', 'a:2:{s:4:"unit";s:2:"h1";s:5:"value";s:13:"Skype Lessons";}', '<p class="p1">I give face-to-face Skype lessons for individuals and groups. The lessons are 45-minutes long and cost 20 Euros per lessons. For native speaks of Spanish, German or Dutch I teach all levels, and at intermediate level for native speakers of all other languages. Together we focus on speaking, as it is most important, and through homework and working projects, we perfect grammar and written skills.[nbsp]You only need a camera, a microphone and the internet. Skype is free!</p>', '', NULL, '', '', '', '', '', '', '', 'above', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', '', NULL, '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', '', '', NULL, '', NULL, '', '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:"";i:1;s:23:"col-md-12 text-centered";}', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', '', '', '', 'ascending', 0, '', '', '', '', 'com_default', NULL, 0, 0, '', 0, '', 10, '', '', '', '', ''),
