(289, 74, 'tl_article', 640, 1505332695, 'text', 'a:2:{s:4:"unit";s:2:"h1";s:5:"value";s:10:"The future";}', '<p>But wait, Amazon has more plans to invade our lives. Not only does it want to use drones to deliver our packages, it has now started opening its own stores. Amazon Book stores are currently only[nbsp]<span style="text-decoration: underline;">operational[nbsp]</span>[nbsp]in the USA, but they could soon be coming to you. As we have seen, Amazon has successfully been destroying it''s competition since it''s arrival onto the market. It began as a simple online[nbsp]<span style="text-decoration: underline;">counterpart</span>, but now has a very real physical presence in our lives. Amazon book shops will be the only book shops if people do not support l<span style="text-decoration: underline;">ocal traders,</span>[nbsp]with its complex and efficient supply chain as well as it''s massive size, Amazon will almost always be able to offer cheaper books than local shops.</p>', '', NULL, '', '', '', '', '', '', '', 'above', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', '', NULL, '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', '', '', NULL, '', NULL, '', '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', '', '', '', 'ascending', 0, '', '', '', '', 'com_default', NULL, 0, 0, '0', 0, '', 10, '', '', '', '', ''),
