(291, 40, 'tl_calendar_events', 64, 1505334403, 'text', 'a:2:{s:4:"unit";s:2:"h1";s:5:"value";s:12:"Instructions";}', '<p>In this lesson we will be discussing the expansion of big companies, specifically Amazon. We will be reading the following article. You might want to look up some business vocabulary such as different types of companies, retail and internet terms[nbsp]</p>', '1', 0x1e46e5a297df11e7868e0cc47adc87ce, '', '', 'a:3:{i:0;s:0:"";i:1;s:0:"";i:2;s:0:"";}', 'a:5:{s:6:"bottom";s:0:"";s:4:"left";s:0:"";s:5:"right";s:0:"";s:3:"top";s:0:"";s:4:"unit";s:0:"";}', '', '', '', 'above', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', '', NULL, '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', '', '', NULL, '', NULL, '', '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', '', '', '', 'ascending', 0, '', '', '', '', 'com_default', NULL, 0, 0, '0', 0, '', 10, '', '', '', '', ''),
