(2, 1, 128, 1505246483, 'Marker Alicante', 'MARKER', '', 'de', '38.359950, -0.459574', 'SIMPLE', 'INFO', NULL, '1', NULL, NULL, 'a:3:{i:0;s:2:"16";i:1;s:2:"16";i:2;s:2:"px";}', 'a:3:{i:0;s:1:"0";i:1;s:1:"0";i:2;s:2:"px";}', '', NULL, 'a:3:{i:0;s:2:"32";i:1;s:2:"32";i:2;s:2:"px";}', '000000', '100', '1', '', '100', '1000', '', 1, '', '', '', '<p>I enjoyed my week in Valencia. The weather was bright and so where the people. My next destination was Alicante, a city which was not new for me, as I had visited it many times as a child. When I was 8 I lived in Spain for 6 months with my parents...a story for a different time. This time I stayed in a youth hostel which was a lot nicer inside than it was out. Very sociable with lots of different types of people coming and going. I made some nice friends whom I went round the city with and being February still, the streets weren''t yet filled with tourists</p>', 'a:3:{i:0;s:1:"0";i:1;s:1:"0";i:2;s:2:"px";}', 'a:3:{i:0;s:1:"0";i:1;s:1:"0";i:2;s:2:"px";}', '', '', '', NULL, '', '1', '0', '1', '0', '1'),
(3, 1, 64, 1505246265, 'Marker Barcelona', 'MARKER', '', 'es', '41.390648, 2.178978', 'SIMPLE', 'INFO', NULL, '1', NULL, NULL, 'a:3:{i:0;s:2:"16";i:1;s:2:"16";i:2;s:2:"px";}', 'a:3:{i:0;s:1:"0";i:1;s:1:"0";i:2;s:2:"px";}', '', NULL, 'a:3:{i:0;s:2:"32";i:1;s:2:"32";i:2;s:2:"px";}', '000000', '100', '1', '', '100', '1000', '', 1, '', '', '', '<p>Here I began my journey it Spain. I started by booking myself a flight to Barcelona in February. I originally wanted to go in January, I booked my flight and all, but couldn''t go in the end. Before leaving I had to finally get my driving licence and do my test. I was so good at driving soI didn''t expect to fail my driving test, so I booked the flight for the day afterwards. I did fail, and couldn''t go on the flight. Bad luck, but thanks to Ryanair, I ony paid 36 Euros in total for the flight so I didn''t lose much money.[nbsp]</p>', 'a:3:{i:0;s:0:"";i:1;s:0:"";i:2;s:2:"px";}', 'a:3:{i:0;s:0:"";i:1;s:0:"";i:2;s:2:"px";}', '', '', '', NULL, '', '1', '0', '1', '0', '1'),
(4, 1, 96, 1505246287, 'Marker Valencia', 'MARKER', '', 'es', '39.473520, -0.376276', 'SIMPLE', 'INFO', NULL, '1', NULL, NULL, 'a:3:{i:0;s:2:"16";i:1;s:2:"16";i:2;s:2:"px";}', 'a:3:{i:0;s:1:"0";i:1;s:1:"0";i:2;s:2:"px";}', '', NULL, 'a:3:{i:0;s:2:"32";i:1;s:2:"32";i:2;s:2:"px";}', '000000', '100', '1', '', '100', '1000', '', 1, '', '', '', '<p>After having a lot of fun exploring Barcelona, I decided it was time to leave after a week. I made a really great friend in the hostel I stayed at. He was a programmer and digital nomad like myself. He was sad to see me go. I took the train to Valencia and stayed in an AirBnB with two fun guys from Chile. One had the same music taste as me and we had a chilled out rap party on his roof[nbsp]</p>', 'a:3:{i:0;s:0:"";i:1;s:0:"";i:2;s:2:"px";}', 'a:3:{i:0;s:0:"";i:1;s:0:"";i:2;s:2:"px";}', '', '', '', NULL, '', '1', '0', '1', '0', '1');
