(1, 3, 1505057139, 'Samlernen Finally Online', 'NA__First_Article', 1, 1501567800, 1501567800, '', '<p>It''s finally here, the new SamLernen website![nbsp]</p>', '1', 0xb2b3ae9e94a111e7adfad578d8d19268, '', 'a:3:{i:0;s:0:"";i:1;s:0:"";i:2;s:0:"";}', 'a:5:{s:6:"bottom";s:0:"";s:4:"left";s:0:"";s:5:"right";s:0:"";s:3:"top";s:0:"";s:4:"unit";s:0:"";}', '', '', '', 'above', '', NULL, 'default', 0, 0, '', '', '', '', '', '1', '', ''),
(3, 3, 1505153844, 'Next Stay: Alicante', 'next-stay-alicante', 2, 1505121780, 1505121780, '', '<p>Alicante is always worth a visit and not to be explored in only a couple of days. Have a look where the journey goes to!</p>', '1', 0x61d0bb2e942011e7adfad578d8d19268, '', 'a:3:{i:0;s:0:"";i:1;s:0:"";i:2;s:0:"";}', 'a:5:{s:6:"bottom";s:0:"";s:4:"left";s:0:"";s:5:"right";s:0:"";s:3:"top";s:0:"";s:4:"unit";s:0:"";}', '', '', '', 'right', '', NULL, 'default', 0, 0, '', '', '', '', '', '1', '', ''),
(5, 3, 1505160367, 'American or British English?', 'american-or-british-english', 2, 1505160060, 1505160060, '', '<p>Have you ever wondered which words you shouldn''t say in England to not make people think you are from America - or words you shouldn''t say in America unless you want them to think you speak British English?</p>', '', NULL, '', '', '', '', '', '', 'above', '', NULL, 'default', 0, 0, '', '', '', '', '', '1', '', ''),
(4, 3, 1505153515, '09/11 Terror Attack', 'id-09-11-terror-attack', 2, 1505152560, 1505152560, '', '<p>Today it''s been sixteen years ago that the Twin Towers in Manhattan, New York, were hit by an airplane.</p>', '1', 0x50fb6997971c11e7868e0cc47adc87ce, '', 'a:3:{i:0;s:0:"";i:1;s:0:"";i:2;s:0:"";}', 'a:5:{s:6:"bottom";s:0:"";s:4:"left";s:0:"";s:5:"right";s:0:"";s:3:"top";s:0:"";s:4:"unit";s:0:"";}', '', '', '', 'above', '', NULL, 'default', 0, 0, '', '', '', '', '', '1', '', '');
