INSERT INTO `tl_search` (`id`, `pid`, `tstamp`, `title`, `url`, `text`, `filesize`, `checksum`, `protected`, `groups`, `language`) VALUES
(1, 54, 1505382792, 'Welcome', 'http://samlernen.de/index.php/PA__Welcome.html', 'Welcome Welcome to Sam Systems English with Sam Face to face English classes online with a British native speaker travelling the world. Come and explore it with me in English Who we are? Hi, I''m Sam, the creator of SamLernen. Here I offer everyone an exciting new way of learning English online, for work, for school or for your own personal development. I am a TEFL certified digital nomad who travels Europe and teaches online. I created SamLernen to provide our own exciting platform to teach and organise our courses and communication with our language learners. We believe that the best way to teach English is to offer interesting and exiting content where we learn English through discussion and analysis of world events, philosophy, history. We also work on creative web projects together, using internet technologies to make it even more interactive. The future of learning is here. Skype Lessons I give face-to-face Skype lessons for individuals and groups. The lessons are 45-minutes long and cost 20 Euros per lessons. For native speaks of Spanish, German or Dutch I teach all levels, and at intermediate level for native speakers of all other languages. Together we focus on speaking, as it is most important, and through homework and working projects, we perfect grammar and written skills. You only need a camera, a microphone and the internet. Skype is free! Articles Events Events Events News Events News Events Learning Style I think differently and I am definitely not not politically correct. I say what I want and you should too! Our lessons are a place for free discussion and debate. We like to teach English by discovering what the language really has to offer us. We learn by taking a closer look at world events, music, crime, drugs, history, new technologies and travel. We encourage co-operation and the involvement of friends. Anything that makes learning more fun, makes it easier. You can do a course online with your friends/colleagues in the same room or using different computers. The more people, the more fun. Login in and Learn With SamLernen, you have the option to make an account and login. I only activate sign-up requests from clients. When you are signed up, you can organise all of your course work and your lesson times. This is very helpful, as it makes it more easier to access your course information when you are using a work computer or a mobile.When you are logged in, you also have other options like managing your payments, tracking your progress and accessing premium content Contao Demo, , News, Events', 17.19, '8080c6d2e53329d1a7de47b92f4093df', '', 0x30, 'en'),
(2, 51, 1505382781, 'Articles', 'http://samlernen.de/index.php/articles.html', 'Articles Articles that I have written Articles Here are many articles for English learners. Leave a comment Contao Demo', 13.2, '8afbd5f0291235ae36747f1ed84d71c8', '', 0x30, 'en'),
(3, 68, 1505380490, 'How can we stay anonymous?', 'http://samlernen.de/index.php/how-can-we-stay-anonymous.html', 'How can we stay anonymous? Leave a comment Contao Demo', 11.48, '4ffa4ca4b201244cceb520739bf9124b', '', 0x30, 'en'),
(4, 67, 1505380491, 'The Expansion of Amazon', 'http://samlernen.de/index.php/the-expansion-of-amazon.html', 'The Expansion of Amazon The 44th biggest company in the world ...on the way to being number 1? The expansion of Amazon Amazon, a word which once made people think of the rain forest in Brazil is now a household name and it is growing. Amazon started as a simple book retailer, which then branched out into selling other items, soon it had become a huge competitor to Ebay and now usually outsells them. Amazon has launched itself in 16 countries worldwide and sells more and more every year. How is it so successful? Many describe the business model of Amazon as one which "is designed to strangle and kill off local business", they do this by offering lower prices and fairly low delivery times. How do they do this? Offshore tax evasion and highly organised mass production style distribution centres. Workers in these centers often complain of low wages, limited toilet breaks and harsh working conditions. Amazon has recently began to expand its presence and many post offices and university campuses now have Amazon delivery stations Expanding into our lives Where can we now see Amazon? How about in your own home! Yes Amazon has recently launched its Amazon Echo. A device which sits somewhere in your home, perhaps your kitchen and living room. It listens to all conversation and its AI is activated when you talk to it by name, Alexa. It can be used for many things such as saving and reading shopping lists, reading audiobooks, playing music, asking general questions to Google and primarily, for shopping. Watch the Youtube video, a UK commercial for the Amazon Echo. A common remark is that the man has replaced his wife with the Amazon Alexa. The future But wait, Amazon has more plans to invade our lives. Not only does it want to use drones to deliver our packages, it has now started opening its own stores. Amazon Book stores are currently only operational in the USA, but they could soon be coming to you. As we have seen, Amazon has successfully been destroying it''s competition since it''s arrival onto the market. It began as a simple online counterpart, but now has a very real physical presence in our lives. Amazon book shops will be the only book shops if people do not support local traders, with its complex and efficient supply chain as well as it''s massive size, Amazon will almost always be able to offer cheaper books than local shops. Leave a comment Contao Demo,', 15.78, '99a653637bf1cff84e6c13e42253ed1c', '', 0x30, 'en'),
