zon has more plans to invade our lives. Not only does it want to use drones to deliver our packages, it has now started opening its own stores. Amazon Book stores are currently only operational in the USA, but they could soon be coming to you. As we have seen, Amazon has successfully been destroying it''s competition since it''s arrival onto the market. It began as a simple online counterpart, but now has a very real physical presence in our lives. Amazon book shops will be the only book shops if people do not support local traders, with its complex and efficient supply chain as well as it''s massive size, Amazon will almost always be able to offer cheaper books than local shops. Leave a comment Contao Demo,', 16.17, '7f9d58f64eae0fc0348604a350e4360d', '', 0x30, 'en'),
(6, 66, 1505380492, 'How Tourism changes the planet', 'http://samlernen.de/index.php/how-tourism-changes-the-planet.html', 'How Tourism changes the planet What does tourism do to a country? A worldwide overview Tourism has become a very big industry for many countries such as Spain, Thailand and Egypt to name a few. Many countries who decide to welcome tourists, have beautiful landscapes and beaches but few natural resources. For years, Spain has been one of the top tourist destinations in Europe and it has fully embraced this new source of income. After the 2008 financial crisis, countries like Greece, Portugal and Spain were some of the hardest hit countries due to their enormous debt which they could not repay. Spain still heavily relies on it''s tourist industry to survive. It''s other industries such as agriculture and manufacturing do not bring in the same type of money as tourism. Tourism has been good and bad for Spain. The main benefits are financial. It has brought money and many jobs to a country suffering from high unemployment. On the other hand, many complain of the destruction of natural beauty and of the Spanish culture. There are now hundreds of ugly tourist resorts all over Spain, many comprise almost entirely of English, German and Dutch tourists. Locals complain that their old towns have been transformed into modern money machines and that the huge tourist population causes traffic jams and overcrowding. The booming construction industry One big effect of the Spansh tourist industry has been the boom in construction. Second homes, hotels, roads, holiday resorts, theme parks and airports to shuttle in the tourists like farm animals. Many people have objected to the huge structures created and the destruction of nature which has followed. In the following example we see a picture of a the illegal Algarobbico Hotel near Almeria in Andalucia, Spain. The hotel was built in a protected natural park and was deemed illegal by the authorities. Many protested and construction stopped. The problem was that the permission to build was granted in the 1980''s, but construction began in 2003, long after the area had become a natural park. There are hundreds of similar cases of illegal construction and horribly complicated beaurocracy. Cheap air travel One thing which has enabled tourists to come to a country in unprecedented numbers is the rise of cheap flying. Companies such as Ryanair and EasyJet are competing to be the biggest Budget Airline Comany . It''s possible to get a flight from London to Barcelona for just 20 Euros! Many years ago flying was seen as a luxury. Something which only the very rich could afford. Airports were much smaller, more relaxed and usually more comfortable. Many people called this the Golden Age of air travel. Now it is affordable by almost anybody and it is constantly getting cheaper and cheaper and this means that more and more people will be coming on holiday every year. Case study Image you are working for the government of Spain at the Ministry of Tourism. You live in Valencia, this summer the city is expected to see double as many tourists as last year. People are coming from all over the world to see the Science Exhibition. You know that next year the numer of arrivals will double in the region of Valencia. You have 200 million Euros of borrowed money to invest, this means that your bosses need to see a return on the investment, otherwise you will lose your job. Option #1 : Invest the money in building new roads and train lines. Option #2 : Invest the money in creating new hotels and beach resorts Option #3 : Invest the money in expanding or rebuilding the current airport Option #4 : Give the money to local people to help improve their businesses Option #5 : Build a massive hotel complex on the outisde of town Now present your idea at a committee meeting and explain it''s benefits over the other options. Leave a comment Contao Demo,', 17.67, 'ddc9e933e2b71925db791823236c925a', '', 0x30, 'en'),
(7, 63, 1505380494, 'Is Macron the next Trump?', 'http://samlernen.de/index.php/63.html', 'Is Macron the next Trump? I am my Facebook and it is me The power of Facebook.... Sometimes we just need to stop and ask ourselves, how did Facebook get so far? Before 2005 even, many people did not know about Facebook, yet alone have it. Now within the youngest generation. It seems like everybody has a Facebook and the trend of social media is not dying out. More and people are signing up with other social networks like Twitter, Instagram, Steam, Playstation Network and Xing. -Do you have a Facebook account? What do you use it for? -How often do you use your Facebook account? As a teenager, I grew up at a time when Facebook was becoming popular. The generation before me did not use Facebook and people only really began to use it around the ages of 14 to 15. Nowadays it seems children as young as 7 - 8 have Facebook. The amount of children with mobile phones is always increasing and with it the amount of Facebook Mobile users. What will Facebook look like in the future? If the current trend of digitalization continues, how will Facebook change? As the company conintue to be profitable, it will continue to develop itself. It will continue to develop new ways for the service to be exiting, it will add more things that humans enjoy like Virtual Reality (they already have plans for it), more integration with our devices and it will continue to use the huge amounts of data we give them. What about the data? This is the most important part. The data that Facebook collects about you, the data many people simply chose to forget about. Depending on the user and how much much they use Facebook, it knows where you are in the world, it knows who your friends are, it knows your opinions about things and it knows what you say to your friends. Conversations and voice calls are recorded, images processed and facially recognised, social patterns analysed; all this by a computer running complex algorithms. Are you worried about what Facebook can do with all your personal information? Do you think the government has access to your information through Facebook? How do you feel about computers analysing your personal information to give you suitable adverts?[ Leave a comment Contao Demo,', 15.12, 'e6b206dc98b6b903f341c128c43bc3ca', '', 0x30, 'en'),
(8, 60, 1505380495, 'Is Macron the next Trump?', 'http://samlernen.de/index.php/cryptocurrencies-copy.html', 'Is Macron the next Trump? Is Macron the next Trump The problems with Macron Macron has been elected the new president of France. Emmanuel Macron won the 2017 French elections against Marine Le Pen with 73% of the votes. Marine Le Pen was seen as a more radical, right-wing politician who wanted France to leave the European Union. But who is this man and is he similar to Donald Trump? He is similar to president Trump in many ways. Both men have a background in business and finance, both presented themselves as "political outsiders" and both were unique candidates in their own way. Le Pen would be the first female president of France and Macron, with a background in investment banking and politics, created his own political party called En Marche and will be the youngest French head of state since Napoleon. Does Macron think like Trump? Macron is a very rich man who made a lot of money with investment banking at Rotschild & Cie Banque. The Rotschild family and its companies are infamous for it''s enormous wealth and global political power. Many claim they form the "Hidden Hand", an elite group of extremely wealthy people, families and companies who really rule the world. Being a successful businessman like Macron or Trump means they must think and act according to simple rules 1) Be open for negotiation, keep in mind needs of all participants 2) Try to turn enemies into friends, war is too expensive 3) Never dwell on your mistakes, business first. Macron''s wife is 24 years older than him Many find it strange how Macron is married toBriget Trogneux, who is 24 years older than him. Their love began when Macron was a 16 year old schoolboy and Bridget was his drama teacher at the school. His parents made him change schools as they were worried about this strange love affair, it didn''t work and they married in 2007. This strange love affair contributed again to Macron''s outsider image, others claim it is a sham marriage or that Macron is actually gay. In a way, this strange love affair a little similar to Melania Trump. For one, they both have big age differences to their husbands who are both the youngest and oldest ever presidents of their countries respectively. The media wanted Macron to win Unlike Trump in Ameria however, Macron was the media favourite. Macron is pro business and the media is big business. It is a business with enormous social power and in this case, it managed to contribute to the new president''s victory. The media can influence any election by p ainting their favourite candidate in a good light and making others look worse. In the example below, we can clearly see Le Pen being compared with Donald Trump. The media has done nothing but make Trump look bad all accross the world. People generally have negative feelings towards Trump. Despite Macron being more similar to trump in less obvious ways, the media used Le Pen''s more radical opinions and even her hair to compare her to Trump. Leave a comment Contao Demo,', 16.15, 'a1918382b64d978e8b50b97c603e26f5', '', 0x30, 'en'),
(9, 59, 1505380495, 'A Different Viewpoint On Feminism', 'http://samlernen.de/index.php/a-different-viewpoint-on-feminism.html', 'A Different Viewpoint On Feminism A Different Viewpoint on Feminism The female and the male moose “Feminism is a political mistake. Feminism is a mistake made by women’s intellect, a mistake which her instinct will recognize.“ (Valentine de Saint-Point) What do you think of feminism? Sit back for a minute and think about it. Ignore the voice in your head which tells you how you should think, just try to make up your own mind. Labeling yourself as a feminist* is a standard. It has become one of the unwritten rules of society. You have to be one, or you are medieval, sexist, crazy, plain stupid. The underlying premise which the protest is based upon says that there must be equality between men and women. But there is no physical equality.Argue against that? Very hard due to the obvious differences (and still, some try finding reasons). So if there is no physical equality, there still might be a chance of a psychological or mental equality in means of sameness, right? Well, no – because our psychological blueprint is formed by the physical, f.e. by a difference in quantity of hormones, a different energy. There is a truth in the premise of the sheer possibility of equality: Some women appear very manly, because they have higher testosterone levels, have manly features, or their masculine energy is just dominant in contrary to their feminine traits. But this is an exception to the rule. The norm can only be norm because of alterations around that norm. And the rule is that women tend to have a dominant feminine energy and men have a dominant masculine energy. Men and women of course already are equal as long as equal is understood in the most important sense. They have to be because otherwise they couldn’t complement each other so perfectly. On soul-level, how could we be more equal? Manly and feminine energies have the potential to combine most gracefully, even though they are completely polarized. Also, women can keep up with men in many professions because they can fulfill the tasks accurately once they emphasize their masculine energy more than their feminine energy. Think of different professions that are typically crowded with men. Which characteristics does a job as a lawyer require? For which traits do you look in a pilot? What about those of a manager? - If you gather your answers now, you might find that these professions require typically masculine energy which shows in attributes such as non-emotional, decisive, tough-skinned, aggressive, competitive, strong, self-confident, active or hard. I''m not saying that women can''t compete with men in these professions. But is it healthy for them to put so much of an emphasis on masculine traits? Should every women be encouraged to take these career paths just because feminists think that women have to compete with men? Or is competing with men making them more stressed out, because they can''t soar in their natural feminine qualities? Isn''t it even illogical to force women to adapt to a manly working environment? A more distinct example is the military. The military was created by and for men - almost exclusively. Click here for a very informative video about problems of women in the military, where women also give their voice. Also you can do a little research here on infertility in women who attend the military. As long as the job doesn’t require extraordinarily physically hard tasks like the special unit in military, women usually can compete and in some professions generally be better accomplishing success than men. Some exceptional women have also been able to perform as well as men in tasks that specifically require typically male skills. But again: There are exceptions to the rule. As this article goes on, please keep in mind that I am well aware of all kinds of exceptions, and the reason we call it an exception is because there is an opposing general rule. As feminists argue, nurture plays a big role in forming the stereotypical behavior and encouraging stereotypical behavior is bad and wrong. They encourage non-stereotypical behavior arguing that this would be more freeing and true. Again, there is truth in that: Of course we are imprinted by our upbringing and what our surroundings tell us about typical roles for the sexes. Nurture does have an effect on everyone: We either emphasize our male or our female energy – no matter which sex we embody. And: Yes, there is more to personalities than stereotypes. But stereotypes were never meant to describe the whole human being. They exist for the benefit of making it easier to codify something in the first place. The human being is of course too complex for a stereotype. That’s why it is called a stereotype. One problem we have with stereotypes is that the media has perverted them and portrayed them in such a soulless and heartless way that we all began to hate this simple portrayal – simple in the meaning of just dumb. That is one reason why we don’t like stereotypes. We don’t really want to be one of those polished artificial and superficial super dumb men or women as media creates them, because we know we are much more than that. The media has degraded us, degraded our souls. And then we made the mistake of not looking behind the scenes. It’s like with all the good stuff that happened in bad times. Or good symbols that have been perverted by wars. They are being hated nowadays. Not for the essence of what they are, but for the way they have been portrayed. The media is a really bad artist because it has always tried to manipulate people instead of serving them. What a disgrace for us human beings: a violation of our souls. Masculinity and femininity have both been portrayed as dumb. Don’t be a macho, we say, don’t be a bitch, because we see those oversimplified images online and on advertisements and they insult our human complexity. So we want to stay as far from them as possible. But masculinity and femininity are very deep constructs! They are deep because they are so natural and wild and to be explored! Have you ever behaved differently than you originally intended to just because you thought that you don''t want to act like a stereotype? What is deeply rooted in our genes subconsciously rules us. Nonetheless the movement seems to deny that there is something such as feminine and masculine. Isn''t this absurd? And as long as we ignore that, unconscious of our true wishes (leading to a philosophical Alan Watts podcast about our innermost dreams), we women and men are trained to ignore our nature. We are brainwashed into building up artificial behaviors instead of inside-listening to what we really want to do with our lives. Just ask young men and women between age 18 and 25 today what they want to do with their lives. Surely, their usual uneasiness and irritation about this question is a result of various circumstances nowadays, but heck, they are confused. Could this have something to do with feminism? Could it be because they lack role models and nobody tells them to embrace their natural femininity or masculinity anymore but behave contrary to it? - Do you personally think that women have become more manly and men have become more feminine? The birth control pill makes women choose less manly men. If you think this further - generations ahead - there might be a worldwide mentality change because masculinity is not as politically popular anymore as it was in former times. Click this link to a scientific report which points out that on a chemical level, exactly this could be true. But then again, women live out their fantasies in books like Fifty Shades of Grey. So, naturally (and not in a politically ''correct'' way) masculinity is still very much in fashion. The theories that feminism is based upon might be nice to discuss, but reality reveals that women generally like and crave a smart, strong, non-abusive, loving male leadership while men like to lead. The degradation of masculinity by feminism has been taken far. Only women are being portrayed as victims. But fact is: Both men and women can exploit and abuse on another, and history shows that they have different ways of doing so, but both are equally harmful. Both men and women like balanced communication, but each sex has their unique approach to that as they have their own definition of ‚balance‘: Women generally – as long as you look at it objectively – try to establish a horizontal, harmonious communication, while men usually engage in a not less attentive communication dance of figuring out their hierarchy with each other, which is a vertical form of communication. Both women and men have their own ways of winning against members of the same sex. Imagine school boys fighting against each other, they literally tend to carry out fist fights whereas the girls, among each other, would mostly play psychological mind games to outrule each other. Both ways of competing in the realm of the own sex is equally horrible for the defeated one. Can you think of situations where both men and women have the same aim, but they reach it in a completely different way? The urging cry for equality is misleading. The underlying premise says, there has to be equality. But there is none – neither physically nor mentally. And that is not even the point. The whole point of doing something can’t lie in righteousness. As the quote above expresses, logical thinking could mislead us to conclude that we need equality because we don’t have it. The question we have to ask ourselves instead, wholeheartedly, is if we would be more happy if we would become naturally equal (which is just impossible) or if we would artificially dissolve natural gender roles. We already can examine that because the social experiment has been going on for decades. Most likely, women feel more stressed out nowadays because it is expected from them to pursue a career and have children and be a good mother and have fun outside of the family. This may apply to men as well, although there’s always been a weight of the breadwinner and protecting responsibility on them. Plus, they suppress their natural energies as it is not acceptable anymore to just want being a housewife and men don’t dare to even get close to discovering their manliness because that is being frowned upon. Feminism doesn’t ask for inner fulfillment. Otherwise it would respect everyone’s each unique way to that fulfillment. Traditional approaches are being demonized. So what is the whole point of feminism after women have gained exactly the same rights as men nowadays? Competing with men doesn’t make women truly happy. It strengthens their self-confidence. It feeds their pride, but it takes away an important depth of their satisfaction and their happiness. Some women cry over how they want to be like men although they have such unique abilities, beauty and grace inside. The measure for real quality of happiness has been replaced so fundamentally that it is even hard for women who want to dive into their natural femininity to connect with it. As a result, the same has happened for masculinity. We don’t need equality but fulfillment. The differences between the sexes aren’t compatible with the ridiculous concept of unfair/fair, justice in equality. Can you think of some differences that you find unfair as such? Is it unfair to women that they bleed every month and have cramps and are more likely to be less attractive as they age while men don’t have that and tend to be more attractive as they age? Is it unfair that men have to go to war and die for the women they protect and have to become mental robots in order to endure that soulpain? Is it unfair that they commit more suicide and are more likely to be killed, or that they are expected to be strong and manly all the time and carry a lot of responsibility? Is it unfair that they had to do the dirty work of building the whole infrastructure of the planet? Statistically, they did! Only a few women helped, the exceptions. Is it unfair that only women can feel what it is like to have a new life growing inside them and feel that incredible motherly bond to their child? Is it unfair that men technically could just walk away after making a baby? Nature just created those differences in order to give us an amazing compatibility of each other if we fully engage with our innermost nature and complement each other with our unique talents and help each other out. We need each other. Men need women and women need men. Without each other, no babies, no new life. We need each other for each others individual and biological strength the other sex doesn’t have. Women have a different strength than men! And we always use it for our benefit. There is nothing bad in the essence of that. It is part of the natural order. We should admire the opposite sex instead of demonizing it. That goes for feminists as well as groups like MGTOW (Men Going Their Own Way). Our instincts keep reminding us that the feminist concept is only satisfying for a very small number of people. Feminism teaches us to hate the other sex, it teaches men to hate women and women to hate men. It teaches women to become the male version of themselves in a working world which underlies masculine mechanism. Therefore feminism is a disgrace for humankind – for men and for women. They want to make it a general social rule when at the same time its ideas oppose the general nature of humankind. It is in a men’s best interest to take back the lead and rediscover their manliness and for women to dive deeper into their femininity. If you want to do this, dear reader, you will be no more bored of life. You can just relax, forget about what you heard from feminism and try to live your own authentic life. You won’t have to drown your boredom with replacement-satisfactions anymore. You will see the concept of yin and yang working its way into your consciousness, and suddenly, you open your eyes to an exciting, spirit-full, beautiful world. Dreams may just become reality. If you''re interested in further reading into this opinion on feminism look also at: Article on how to embrace femininity as a woman Understanding specific behaviors of both men and women better Men are from Mars and Women are from Venus Author of „The Flipside of Feminism“ What is a husband? Modern life stresses women out *This article refers to feminism in countries like Germany, Switzerland, Austria, France, United Kingdom, United States of America. This article was originally published on https://crispymindseeds.wordpress.com/. Leave a comment Contao Demo, A female and a male moose', 29.05, '8516976207797f1809cdd36e9ef53710', '', 0x30, 'en'),
