(29, 10, 1505382787, 'About Me', 'http://samlernen.de/index.php/about.html', 'About Me About Samuel Furneaux the author of this page Home Hi I''m Sam Nice to see that somebody is reading about me! I’m a man from England who loves to work and travel. I work as a freelance web developer and online English teacher. My hobbies are travelling, languages and meeting different people. I like to be different and don’t really care what other people think about me. I’m currently living in the south of Spain. Sometimes I sleep on mountains next to castles, sometimes in abandoned villas and sometimes in cosy AirBNBs. I also spent 3 weeks in a stunningly beautiful hippy village smoking weed and taking LSD. I live the nomad life and hate to be normal, boring or politically correct. The world needs to change, and we should be able to say what we believe. I channel my inspiration from all my travels and crazy activities into giving fun and exciting English lessons. English teaching and skills When I was 19, I left my home of Penzance, England for Germany. It was a lot of fun and very exciting. It was my first big adventure. I got my TEFL qualification and went to work teaching at language schools in Hannover. I also worked at the university . I found it more fun giving private English lessons. I could talk about what I want and cut out the boring shit that the language schools made me teach. I later worked for Continental teaching business English as well as some other small engineering firms where I taught and translated. Hi I''m Sam Nice to see that somebody is reading about me! I’m a man from England who loves to work and travel. I work as a freelance web developer and online English teacher. My hobbies are travelling, languages and meeting different people. I like to be different and don’t really care what other people think about me. I’m currently living in the south of Spain. Sometimes I sleep on mountains next to castles, sometimes in abandoned villas and sometimes in cosy AirBNBs. I also spent 3 weeks in a stunningly beautiful hippy village smoking weed and taking LSD. I live the nomad life and hate to be normal, boring or politically correct. The world needs to change, and we should be able to say what we believe. I channel my inspiration from all my travels and crazy activities into giving fun and exciting English lessons. Contao Demo,', 16.07, 'd041493a6a21f71cd0fa25062e9a0db8', '', 0x30, 'en'),
