(54, 20, 1505380509, 'American or British English?', 'http://samlernen.de/index.php/news/american-or-british-english.html', 'American or British English? Have you ever wondered which words you shouldn''t say in England to not make people think you are from America - or words you shouldn''t say in America unless you want them to think … Home News from Sam and Josefine British English: American English: Chips French Fries News from Reuters Contao Demo', 16.45, '080dad0b10c776c921f89abe33d32991', '', 0x30, 'en'),
(55, 20, 1505380509, '09/11 Terror Attack', 'http://samlernen.de/index.php/news/id-09-11-terror-attack.html', '09/11 Terror Attack Today it''s been sixteen years ago that the Twin Towers in Manhattan, New York, were hit by an airplane. Home News from Sam and Josefine The Terror Attack of 09/11 Sixteen years ago on this day, the 11th September, an airplane crashed into the famous Twin Towers in New York. 3000 people died, and the world was left with a shock that for many resulted in a trauma. Even if you haven''t been directly and personally affected, may it be possible that behind this date, there is a story bigger than its already devastating effects on its own? Could it be that there are actual psychological effects on not only a small number of naturally traumatized relatives and friends, but also on a whole continent - or the world which has watched the news? In a soon upcoming article, we will address this question and take the facts into further inquiry. News from Reuters Contao Demo,', 17, '1252a10ed3314e71f9fe0b29c531f618', '', 0x30, 'en'),
(56, 20, 1505380510, 'Next Stay: Alicante', 'http://samlernen.de/index.php/news/next-stay-alicante.html', 'Next Stay: Alicante Alicante is always worth a visit and not to be explored in only a couple of days. Have a look where the journey goes to! Home News from Sam and Josefine Next Stay: Alicante Alicante is always worth a visit and not to be explored in only a couple of days. To really get a feeling for this city you have to stay longer - this one will be about three weeks. But how do you explore a city best - by sleeping under the stars on a mountain, renting a youth hostel or Airbnb, or even checking into a hotel? This time, we opted for a very reasonably priced Airbnb. Our host who shares her apartment with us is an artist and the whole apartment is furnished with beautiful portrait paintings. Staying in an Airbnb isn''t only a fantastic opportunity for getting to know such interesting people, but also improve your Spanish language skills, because Airbnb''s are often rented by them. After sunset on Alicante''s Castillo De Santa Barbara News from Reuters Contao Demo,', 16.8, '35d77c17865894864bb202bd891e3ae3', '', 0x30, 'en'),
(57, 20, 1505380510, 'Samlernen Finally Online', 'http://samlernen.de/index.php/news/NA__First_Article.html', 'Samlernen Finally Online It''s finally here, the new SamLernen website! Home News from Sam and Josefine It''s finally here, the new SamLernen website! News from Reuters Contao Demo', 15.72, 'cab49a28e665a8369d38714d215cc5f7', '', 0x30, 'en');
